import React from 'react';

const AIResumeBuilder: React.FC = () => {
  return (
    <div className="bg-card-yellow rounded-xl p-6 shadow-card">
      <h2 className="text-2xl font-semibold mb-4">AI Resume Builder</h2>
      <ul className="space-y-4 mb-6">
        <li className="flex items-center">
          <div className="h-2 w-2 bg-red-500 rounded-full mr-3"></div>
          <span className="text-gray-700">Create Resume</span>
        </li>
        <li className="flex items-center">
          <div className="h-2 w-2 bg-red-500 rounded-full mr-3"></div>
          <span className="text-gray-700">Analyse Resume</span>
        </li>
        <li className="flex items-center">
          <div className="h-2 w-2 bg-red-500 rounded-full mr-3"></div>
          <span className="text-gray-700">Generate Cover Letter</span>
        </li>
      </ul>
      <div className="mt-6">
        <img src="/resume-preview.png" alt="Resume Preview" className="w-full h-48 object-contain rounded-lg shadow-sm" />
      </div>
    </div>
  );
};

export default AIResumeBuilder;
